import React from "react";

function OneInner() {
  return (
    <div className="th-one-inner">
      <h2 className="th-header-one-inner">Easy Pay</h2> <br />
      <p className="th-text-one-inner">
        Purchases of products are fast, easy and secure for your customers to
        make. Transactions can now happen confidently hassel free!
      </p>
    </div>
  );
}

export default OneInner;
